description:
CDEveryWhere creates a one-session iso image file that supports Joliet, HFS, RockRidge, and ISO9660 file systems. Most CD Burner applications only support 2 file systems. CDEveryWhere supports all 4 file systems - so your CD data can be shared seamlessly across platforms. 
